import "./App.css";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/home";
import WearthList from "./pages/weatherList";

function App() {
  return (
    <div>
      <Routes>
        <Route index element={<Home />} />
        <Route path="WearthList" element={<WearthList />} />
      </Routes>
    </div>
  );
}

export default App;
